define({"topics" : [{"title":"Page or Offset Number","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_o2m_3xh_kmb","attributes": {"data-id":"concept_o2m_3xh_kmb",},"menu": {"hasChildren":false,},"tocID":"concept_o2m_3xh_kmb-d46e124130","topics":[]},{"title":"Result Field Path","shortdesc":"\n                  <p class=\"shortdesc\">When using any pagination type, you must specify the result field path. The result         field path is the location in the\n                     response that contains the data that you want to         process.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_jr1_k23_kmb","attributes": {"data-id":"concept_jr1_k23_kmb",},"menu": {"hasChildren":false,},"tocID":"concept_jr1_k23_kmb-d46e124192","topics":[]},{"title":"Keep All Fields","shortdesc":"\n                  <p class=\"shortdesc\">When using any pagination type, you can configure the processor to keep all fields in         addition to those in the specified\n                     result field path. The resulting record includes all         fields in the original structure and the result field path that\n                     includes the         data.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_iyh_bj3_kmb","attributes": {"data-id":"concept_iyh_bj3_kmb",},"menu": {"hasChildren":false,},"tocID":"concept_iyh_bj3_kmb-d46e124268","topics":[]},{"title":"Pagination Examples","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_ydl_5bn_kmb","attributes": {"data-id":"concept_ydl_5bn_kmb",},"menu": {"hasChildren":true,},"tocID":"concept_ydl_5bn_kmb-d46e124354","next":"concept_ydl_5bn_kmb-d46e124354",}]});